const LoginControl = () => {
    return (
        <li className="navbar-item navbar-nav-nametag">
          <a className="nav-link" href={url}>
            <Login className="nav-icon"></Login>
            <span className="navlink-text">
              {t(DictionaryProps.Greetings.Welcome, { name: "Marvin Doe" })}
            </span>
          </a>
